import { createStore } from "redux";
import reducer from "../reducers";

const initialState = { 
    user: 'none', 
    isLeftDataLoaded: 0, 
    isRightDataLoaded: 0,  
    rightShowWelcome: 1, 
    rightShowSearchAndResults: 0, 
    rightShowVideo: 0
};

export const store = createStore(reducer, initialState);
